import React from "react";
import { Route, Switch } from "react-router-dom";
import Accueil from "./component/Acceuil/Accueil";
import Nav from "./component/Acceuil/Footer";
import Footer from "./component/Acceuil/Footer";

function App() {
  return (
    <div>
      <Switch>
        <Nav />
        <Route exact path="/">
          <Accueil />
        </Route>
        <Footer />
      </Switch>
    </div>
  );
}

export default App;
